/*Table structure for table `pf_gmuni_user` */

DROP TABLE IF EXISTS `pf_gmuni_user`;

CREATE TABLE `pf_gmuni_user` (
  `ID` varchar(50) COLLATE utf8_bin NOT NULL COMMENT 'ID',
  `name` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '用户名称',
  `code` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '用户编码',
  `sex` char(10) COLLATE utf8_bin DEFAULT NULL COMMENT '性别  1:男 2:女',
  `birthday` date DEFAULT NULL COMMENT '生日',
  `mobile` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '手机号',
  `weixin` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '微信号',
  `mail` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '邮箱',
  `dept_id` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '所属部门',
  `remark` varchar(1000) COLLATE utf8_bin DEFAULT NULL COMMENT '备注',
  `create_time` datetime DEFAULT NULL COMMENT '新增时间',
  `qq` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT 'qq号码',
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

