/*Table structure for table `zs_gmuni_content` */

DROP TABLE IF EXISTS `zs_gmuni_content`;

CREATE TABLE `zs_gmuni_content` (
  `id` varchar(50) COLLATE utf8_bin NOT NULL,
  `title` varchar(300) COLLATE utf8_bin NOT NULL COMMENT '正文标题',
  `content` longtext COLLATE utf8_bin NOT NULL COMMENT '正文内容，富文本',
  `author` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '作者',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '添加时间',
  `click_through` decimal(10,0) DEFAULT NULL COMMENT '点击次数',
  `source` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '来源，待定',
  `parent_code` varchar(300) COLLATE utf8_bin NOT NULL COMMENT '文章对应菜单code',
  `keywords` varchar(500) COLLATE utf8_bin DEFAULT NULL COMMENT '文章关键字',
  `cover` varchar(1000) COLLATE utf8_bin DEFAULT NULL COMMENT '封面的ID',
  `attachment` varchar(1000) COLLATE utf8_bin DEFAULT NULL COMMENT '附件的ID',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '修改时间',
  `sort` decimal(10,0) DEFAULT NULL COMMENT '排序号',
  `top` char(10) COLLATE utf8_bin DEFAULT '0' COMMENT '0:否 1:是',
  `description` varchar(300) COLLATE utf8_bin DEFAULT NULL COMMENT '描述',
  `image_ids` varchar(1000) COLLATE utf8_bin DEFAULT NULL COMMENT '保存正文中的所有图片id',
  `attachment_name` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `content_c_index` (`cover`),
  KEY `content_a_index` (`attachment`),
  KEY `content_index` (`title`,`parent_code`),
  KEY `content_k_index` (`keywords`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

